import Canvas from "Components/Canvas";
import React, { useRef } from "react";

const CanvasContainer = () => {
  const ref = useRef();
  const canvas = ref.current;
  const ctx = canvas.getContext("2d");

  return;
  <>
    <Canvas ref={ref} ctx={ctx} />;
  </>;
};

export default CanvasContainer;
